B.E9=A.a(s(["\uae30\ub3c5\uad50\ub294 \ub2e4\ub978 \uc885\uad50\uc640 \ub2e4\ub978 \ub354 \ub098\uc740 \uac00\uce58\ub97c \uac00\uc9c0\uace0 \uc788\ub2e4.","\uc131\uacbd\uc740 \uc5ed\uc0ac\uc801 \uc0ac\uc2e4\uc774\ub2e4.","\uc608\uc218\ub97c \uc2e0\uc801 \uc874\uc7ac\ub85c \ud574\uc124\ub418\uc5b4\uc57c \ud558\ub09f.","\uc131\uacbd\uc740 \uc778\uac04\uc758 \uc774\uc131\uc73c\ub85c \ube44\ud3c9\ub420 \uc218 \uc5c6\ub2e4.","\ud558\ub098\ub2d8\uc758 \ub73b\uc744 \uc54c\uae30 \uc704\ud574\uc11c\ub294 \uc131\uacbd\uc744 \uc77d\uace0 \ubb35\uc0c1\uc744 \ud574\uc57c \ud55c\ub2e4.","\uc131\uacbd\uc740 \ubb38\uc790\uc801\uc73c\ub85c \ud574\uc11d\ub418\uc5b4\uc57c \ud558\uba70 \uadf8 \uc790\uccb4\ub85c \uc5ed\uc0ac\uc801\uc73c\ub85c \uc0ac\uc2e4\uc774\ub2e4.","\uc608\uc218\uc758 \uc0ac\uc5ed\uc758 \ud575\uc2ec\uc740 \uc0ac\ub78c\ub4e4\uc758 \uc8c4\ub97c \uc0ac\ud558\uae30 \uc704\ud568\uc774\ub2e4.",u.D,"\uc0b0\uc0c1\uc218\ud6c8\uacfc \uac19\uc740 \uac00\ub974\uce68\uc740 \ubb38\uc790 \uadf8\ub300\ub85c \uc9c0\ucf1c\uc9c8 \ud544\uc694\uac00 \uc788\ub2e4.","\uc6e8\uc2a4\ud2b8\ubbfc\uc2a4\ud130 \uc2e0\uc559\uace0\ubc31\uacfc \uac19\uc740 \uac83\uc774 \ud604\ub300 \uc0ac\ub78c\ub4e4\uc744 \uac00\ub974\uce58\ub294 \ubaa8\ubcf8\uc774 \ub420 \uc218 \uc788\ub2e4.","\uad50\ud68c\uc758 \uc804\ud1b5\uc740 \ube44\ud310\uc744 \ud1b5\ud574 \uac1c\ud601\ub420 \uc218 \uc788\ub2e4.","\uad50\ud68c\uc758 \ubaa9\uc801\uc740 \uc601\ud63c\uc744 \uad6c\uc6d0\ud558\uace0 \ud558\ub098\ub2d8\uaed8 \uc778\ub3c4\ud558\ub294 \uac83\uc774\ub2e4."]),t.s)
B.F_=A.a(s(["\uc740\uc0ac\ub97c \ubc1b\uc740 \uc0ac\ub78c\ub4e4\uc5d0 \uc758\ud574 \uad50\ud68c\uac00 \uc9c0\ub3c4\ub418\uc5b4\uc57c \ud55c\ub2e4","\ubc29\uc5b8 \ud1b5\uc5ed \uce58\uc720\uc640 \uac19\uc740 \uc740\uc0ac\ub294 \uad50\ud68c\ub97c \uc0c8\ub86d\uac8c \uc6c0\uc9c1\uc774\ub294 \ub3d9\ub825\uc774\ub2e4","\uc131\ub839\uc758 \uad8c\ub2a5\uc774 \uc5c6\ub294 \uc0ac\ub78c\uc740 \uac00\uc9dc \uc2e0\uc559\uc778\uc774\ub2e4.","\uad50\ud68c\uc758 \uc9c0\ub3c4\uc790\ub4e4\uc740 \ubaa8\ub450 \uc2e0\uc559\uc778\uc73c\ub85c \ud558\ub098\ub2d8\uc5d0 \ub300\ud55c \uacbd\ud5d8\uc774 \uc788\uc5b4\uc57c \ud55c\ub2e4.","\uc2e0\uc559\uc740 \uadf8\uc758 \ud589\ub3d9 \ud2b9\ud788 \uc885\uad50\uc801 \ud589\ub3d9\uacfc \uc740\uc0ac\uc801 \ud604\uc0c1\ub4e4\ub85c\ubd80\ud130 \uac80\uc99d\ub418\uc5b4\uc57c \ud55c\ub2e4.","\uc778\uac04\uacfc \ud558\ub098\ub2d8\uc744 \uc5f0\uacb0\ud574 \uc8fc\ub294 \uac83\uc774 \uad50\ud68c\uc758 \uc5ed\ud560\uc774\ub2e4."]),t.s)
B.DP=A.a(s(["\uc2e0\ud559\uc740 \uc778\ubb38\ud559\uacfc \uac19\uc774 \uacf5\uacf5\uc758 \ud559\ubb38\uc774\ubbc0\ub85c \uc2e0\uc559\uc774 \uc5c6\uc5b4\ub3c4 \uc2e0\ud559\uc5d0 \uae30\uc5ec\ud560 \uc218 \uc788\ub2e4.","\uad50\ud68c\ub294 \ud604\ub300\uc801\uc774\uace0 \uc774\uc131\uc801\uc778 \uac00\uce58\ub97c \uac00\uc9c0\uace0 \uc788\uc5b4\uc57c \ud604\ub300 \uc0ac\ud68c\uc5d0 \uc62c\ubc14\ub978 \uae38\uc744 \uc81c\uc2dc\ud560 \uc218 \uc788\ub2e4.","\uad50\ub9ac\ub098 \uc2e0\uc559\uace0\ubc31\uc744 \uc778\uc815\ud558\uace0 \ub530\ub978\ub2e4\uba74 \uad50\ud68c\uc758 \uc9c0\ub3c4\uc790\ub85c \uc138\uc6b8 \uc218 \uc788\ub2e4.","\uc62c\ubc14\ub978 \uc2e0\ud559\uc774 \uc5c6\ub2e4\uba74 \uad50\ud68c\ub294 \uc778\ubb38\ud559 \uac15\uc2b5\uc18c\ub098 \ubab0\uc9c0\uc131\uc801\uc778 \uc9d1\ub2e8\uc774 \ub420 \uac83\uc774\ub2e4.","\uc131\ub839\uc758 \uad8c\ub2a5\uc774\ub098 \uc740\uc0ac\uc801 \ud604\uc0c1\uc740 \ub2e8\uc9c0 \uc8fc\uad00\uc801\uc778 \uc694\uc18c\uc77c \ubfd0\uc774\ub2e4.","\uad50\ud68c\ub294 \ube44\uae30\ub3c5\uad50\uc778\ub4e4\ub3c4 \uc0ac\uc5ed\uc758 \ub300\uc0c1\uc73c\ub85c \uace0\ub824\ud560 \ud544\uc694\uac00 \uc788\ub2e4."]),t.s)
